<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Calculator</title>
    
</head>


<script src="https://cdn.jsdelivr.net/lodash/4.10.0/lodash.js"></script> 
<script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
<script>
    'use strict'
    let list =[];
    function binary_search(item, list){
      let low = 0;
      let high = (length.list) - 1;
      while(low<=high){
        let mid = (low + high);
        let guess = list[mid];
        if(guess == item){
          return Number(mid);
        }
        else if(guess > item){
          return Number(high = mid - 1);
        }
        else {
          low = mid + 1;
          return null;
        }
      }
    }

    list = [1,33,333,3333];
    alert(binary_search(33));
    
</script>


</html>
